import React, {useContext} from 'react';
import { UsersContext } from '../context/ListContext';

const List = () => {
    const userContext = useContext(UsersContext);

    return (
        <>
            <div>
                <ul>
                    {userContext.users.map((user) => <li key={user.email}>{user}</li>)}
                </ul>
            </div>
        </>
    )
}

export default List;
